# <h3>Library Imports</h3>
import sys
import math
while 1: #game loop
    #Initialized variables for max and index_max
    max = 0
    index_max = 0
    for i in range(8):
        mountain_h = int(input())  # represents the height of one mountain.
        if mountain_h > max:
            max = mountain_h
            index_max = i
    
    print(index_max)
